import React, { } from 'react';
import '../index.css';
import Navbar from './navbar';
import Footbar from './footer';
import { Card } from 'react-bootstrap';


const Home = () => {


  return (
        <><Navbar />
        <Card > 
            Hello, User!
            <div style={{"width":"200px" ,"backgroundColor": "#a6b0bf", "padding":50}} className="row">
                <div class="align-middle" style={{"width": "45%"}}><span class="align-middle">Experiment</span></div>
                <div class="align-middle" style={{"width": "45%"}}><span class="align-middle">Classroom</span></div>

            </div>
        </Card>

        <Footbar /></>
    )
};

export default Home
